import React from 'react';
import styled from 'styled-components';

const Header = () => {
  return (
    <Container>
      <Nav>
        <div>
          <img src='https://rerollcdn.com/brand.svg' alt='Logo' />
        </div>
      </Nav>
      <Menu></Menu>
    </Container>
  );
};

export default Header;

const Container = styled.div``;

const Nav = styled.div``;

const Menu = styled.div``;
